function Final(props) {
  const u = props.user;
  return (
    <div className="flex flex-col font-mono text-3xl">
      <div>Name:{u.name}</div>
      <div>MobileNumber:{u.mobilenumber}</div>
      <div>Address</div>
      <div>OrderId</div>
      <div>Estimated Time</div>
    </div>
  );
}
export default Final;
